import starFull from './star_full.svg';
import starHalf from './star_half.svg';
import starEmpty from './star_empty.svg';

export default function StarIcon({star}) {

    return (
        <>
        { 
            star === 1 ?
            <img
                className="full" 
                src={starFull} />
            : star === 0.5 
            ? <img 
                className="half" 
                src={starHalf} /> 
            : <img
                className="empty" 
                src={starEmpty} />
        }
        </>
    )
}
